<script type="text/javascript">gnuplot.init = function() {};</script>
<script type="text/javascript">
var canvas, ctx;
gnuplot.grid_lines = true;
gnuplot.zoomed = false;
gnuplot.active_plot_name = "gnuplot_canvas";

function gnuplot_canvas() {
canvas = document.getElementById("gnuplot_canvas");
ctx = canvas.getContext("2d");
// Gnuplot version 5.0.3
// short forms of commands provided by gnuplot_common.js
function DT  (dt)  {gnuplot.dashtype(dt);};
function DS  (x,y) {gnuplot.dashstart(x,y);};
function DL  (x,y) {gnuplot.dashstep(x,y);};
function M   (x,y) {if (gnuplot.pattern.length > 0) DS(x,y); else gnuplot.M(x,y);};
function L   (x,y) {if (gnuplot.pattern.length > 0) DL(x,y); else gnuplot.L(x,y);};
function Dot (x,y) {gnuplot.Dot(x/10.,y/10.);};
function Pt  (N,x,y,w) {gnuplot.Pt(N,x/10.,y/10.,w/10.);};
function R   (x,y,w,h) {gnuplot.R(x,y,w,h);};
function T   (x,y,fontsize,justify,string) {gnuplot.T(x,y,fontsize,justify,string);};
function TR  (x,y,angle,fontsize,justify,string) {gnuplot.TR(x,y,angle,fontsize,justify,string);};
function bp  (x,y) {gnuplot.bp(x,y);};
function cfp () {gnuplot.cfp();};
function cfsp() {gnuplot.cfsp();};

gnuplot.hypertext_list = [];
gnuplot.on_hypertext = -1;
function Hypertext(x,y,w,text) {
    newtext = {x:x, y:y, w:w, text:text};
    gnuplot.hypertext_list.push(newtext);
}
gnuplot.dashlength = 400;
ctx.lineCap = "round"; ctx.lineJoin = "round";
CanvasTextFunctions.enable(ctx);
ctx.strokeStyle = "rgb(215,215,215)";
ctx.lineWidth = 1;

ctx.lineWidth = 1;
ctx.strokeStyle = "rgb(000,000,000)";
ctx.beginPath();
M(440,3800);
L(540,3800);
M(5759,3800);
L(5659,3800);
ctx.stroke();
ctx.closePath();
ctx.fillStyle = "rgb(000,000,000)";
T(360,3850,10.0,"Right"," 0");
ctx.beginPath();
M(440,3345);
L(540,3345);
M(5759,3345);
L(5659,3345);
ctx.stroke();
ctx.closePath();
T(360,3395,10.0,"Right"," 2");
ctx.beginPath();
M(440,2890);
L(540,2890);
M(5759,2890);
L(5659,2890);
ctx.stroke();
ctx.closePath();
T(360,2940,10.0,"Right"," 4");
ctx.beginPath();
M(440,2435);
L(540,2435);
M(5759,2435);
L(5659,2435);
ctx.stroke();
ctx.closePath();
T(360,2485,10.0,"Right"," 6");
ctx.beginPath();
M(440,1980);
L(540,1980);
M(5759,1980);
L(5659,1980);
ctx.stroke();
ctx.closePath();
T(360,2030,10.0,"Right"," 8");
ctx.beginPath();
M(440,1526);
L(540,1526);
M(5759,1526);
L(5659,1526);
ctx.stroke();
ctx.closePath();
T(360,1576,10.0,"Right"," 10");
ctx.beginPath();
M(440,1071);
L(540,1071);
M(5759,1071);
L(5659,1071);
ctx.stroke();
ctx.closePath();
T(360,1121,10.0,"Right"," 12");
ctx.beginPath();
M(440,616);
L(540,616);
M(5759,616);
L(5659,616);
ctx.stroke();
ctx.closePath();
T(360,666,10.0,"Right"," 14");
ctx.beginPath();
M(440,161);
L(540,161);
M(5759,161);
L(5659,161);
ctx.stroke();
ctx.closePath();
T(360,211,10.0,"Right"," 16");
ctx.beginPath();
M(440,3800);
L(440,3700);
M(440,161);
L(440,261);
ctx.stroke();
ctx.closePath();
T(440,3950,10.0,"Center"," 1");
ctx.beginPath();
M(1327,3800);
L(1327,3700);
M(1327,161);
L(1327,261);
ctx.stroke();
ctx.closePath();
T(1327,3950,10.0,"Center"," 1.5");
ctx.beginPath();
M(2213,3800);
L(2213,3700);
M(2213,161);
L(2213,261);
ctx.stroke();
ctx.closePath();
T(2213,3950,10.0,"Center"," 2");
ctx.beginPath();
M(3100,3800);
L(3100,3700);
M(3100,161);
L(3100,261);
ctx.stroke();
ctx.closePath();
T(3100,3950,10.0,"Center"," 2.5");
ctx.beginPath();
M(3986,3800);
L(3986,3700);
M(3986,161);
L(3986,261);
ctx.stroke();
ctx.closePath();
T(3986,3950,10.0,"Center"," 3");
ctx.beginPath();
M(4873,3800);
L(4873,3700);
M(4873,161);
L(4873,261);
ctx.stroke();
ctx.closePath();
T(4873,3950,10.0,"Center"," 3.5");
ctx.beginPath();
M(5759,3800);
L(5759,3700);
M(5759,161);
L(5759,261);
ctx.stroke();
ctx.closePath();
T(5759,3950,10.0,"Center"," 4");
ctx.beginPath();
M(440,161);
L(440,3800);
L(5759,3800);
L(5759,161);
L(440,161);
ctx.closePath();
ctx.stroke();
if (typeof(gnuplot.hide_gp_plot_1) == "undefined"|| !gnuplot.hide_gp_plot_1) {
ctx.strokeStyle = "rgb(148,000,211)";
ctx.strokeStyle = "rgb(000,000,000)";
T(5099,374,10.0,"Right","\"input_data.dat\"");
ctx.strokeStyle = "rgb(148,000,211)";
Pt(0,440,3573,60.0);
Pt(0,2213,2890,60.0);
Pt(0,3986,1753,60.0);
Pt(0,5759,161,60.0);
Pt(0,5389,324,60.0);
} // End gp_plot_1 
ctx.lineWidth = 2;
ctx.strokeStyle = "rgb(000,000,000)";
DT(gnuplot.solid);
ctx.lineWidth = 1;
ctx.beginPath();
M(440,161);
L(440,3800);
L(5759,3800);
L(5759,161);
L(440,161);
ctx.closePath();
ctx.stroke();

// plot boundaries and axis scaling information for mousing 
gnuplot.plot_term_xmax = 600;
gnuplot.plot_term_ymax = 400;
gnuplot.plot_xmin = 44.0;
gnuplot.plot_xmax = 575.9;
gnuplot.plot_ybot = 380.0;
gnuplot.plot_ytop = 16.1;
gnuplot.plot_width = 531.9;
gnuplot.plot_height = 363.9;
gnuplot.plot_axis_xmin = 1;
gnuplot.plot_axis_xmax = 4;
gnuplot.plot_axis_ymin = 0;
gnuplot.plot_axis_ymax = 16;
gnuplot.plot_axis_x2min = "none"
gnuplot.plot_axis_y2min = "none"
gnuplot.plot_logaxis_x = 0;
gnuplot.plot_logaxis_y = 0;
gnuplot.plot_axis_width = gnuplot.plot_axis_xmax - gnuplot.plot_axis_xmin;
gnuplot.plot_axis_height = gnuplot.plot_axis_ymax - gnuplot.plot_axis_ymin;
gnuplot.plot_timeaxis_x = "";
gnuplot.plot_timeaxis_y = "";
}
